INSERT INTO `ct_movimientos` (`id_movimiento`, `codigo_movimiento`, `descripcionCorta_mov`, `descripcionComp_mov`) VALUES
(2, '1101', 'Baja por renuncia', 'Acto por el cual el trabajador o becario, expresa su voluntad de dar por terminada su relación jurídica laboral con la Secretaría de Salud.'),
(3, '1102', 'Baja por jubilación o pensión', 'Es el acto por el cual términa la relación juridica laboral del trabajador con la secretaría, como consecuencia de encontrarse en los supuestos contenidos en la Ley del ISSSTE, para obtener una jubilación o pensión'),
(4, '1103', 'Baja por defunción', 'Es el acto por el cual cesan los efectos de la relación juridíca laboal del servidor público con la secretaría, como consecuencia de su fallecimiento.'),
(5, '1106', 'Baja por abandono de empleo o labores', 'Es el acto por el cual se da por términada la relación juridíca laboral del trabajador con la secretaría, con base en el dictamen emitido por la autoridad competente, ante el abandono de labores por parte del servidor público sin permiso ni causa justificada.'),
(6, '1104', 'Baja por conclusión de nombramiento o contrato', 'Es el acto por el cual concluye la relación juridíca laboral del servidor público con la secretaría de salud, por cumplirse el objeto o tiempo fijado en el nombramiento o contrato.'),
(7, '1111', 'Baja por incapacidad total y permanente', 'Es el acto por el cual concluye la relación juridíca laboral del servidor público con la secretaría de salud, con base en el dictamen médico del ISSSTE, a causa de la dismunución o pérdida de sus facultades o aptitudes fisicas o mentales que les imposibilitan desarrollar sus labores.'),
(8, '6005', 'Baja por reubicación externa', 'Es el acto por el cual concluye la relación juridíca laboral del servidor público con la secretaría de salud, con base en el dictamen emitido por la autoridad competente, a causa de un cambio en centro de costo presupuestales'),
(9, '1115', 'Baja por inclumplimiento a la norma técnica de enseñanza', 'Es el acto por el cual se da por términada la relación juridíca laboral del trabajador con la secretaría, cpn base en el dictamen emitido por la autoridad competente debido al abandono de las labores técnicas o negligencia dentro del horario asignado, sin permiso ni causa justificada'),
(10, '1105', 'Baja por Insubsistencia', 'Es el acto por el cual queda sin efecto el nombramiento o autorización de beca por no habers presentado el interesado a tomar posesión del encargo conferido, dentro de los cinco primero días habiles posteriore a la fecha de ingreso o reingreso.'),
(11, '1205', 'Suspensión/Baja temporal por responsabilidad administrativa', 'Es el acto por el cual se suspende temporalmente al servidor público en el desempeño de sus funciones, producto de la aplicación de una sanción de acurdo a los establecido en la Ley de Responsabilidades de los Servidores públicos'),
(12, '3002', 'Reanudación de bajas temporales', 'Es el acto por el cual se formaliza la reincoporación de un trabajador a su unidad y puesto despues de haber tenido una baja temporal o suspensión preventiva del pago'),
(13, '1301', 'Suspensión preventiva de Pago por abandono de Empleo', 'Es el acto por el cual se suspende temporalmente el pago al servidor público a consecuencia de que se le haya levantado un acta administrativa, ante un abandono tacito de labores y como una medida preventiva ante la emisión del dictamen definitivo.'),
(14, '1302', 'Suspensión por Abandono de Labores Técnicas', 'SE DA CUANDO YA NO EXISTE UNA RELACION JURIDICA LABORAL DEL TRABAJADOR ANTE LA SECRETARIA, SEGÚN ACTA EMITIDA POR AUTORIDAD COMPETENTE, CUANDO ESTE NO JUSTIFICO SU ASISTENCIA DE LABORES.'),
(15, '1303', 'Suspensión por cancelación de más de tres cheques', 'Es el acto por el cual se suspende temporalmente el pago al servidor público a consecuencia de que se le cancelen tres pago de manera consecutiva por diversos motivos'),
(16, '1304', 'Suspensión por Exceso de Licencias Médicas', 'Es el acto por el cual se suspende temporalmente el pago al servidor público a consecuencia de que es excede de licencias médicas, con base a su antigüedad.'),
(17, '2001', 'Licencia sin sueldo dentro y fuera de la Secretaria', 'Es la facultad de la autoridad para otorgar a un trabajador con nombramiento definitivo, comisión sin goce de sueldo para cumplir un cargo de confianza en el sector público federal.'),
(18, '2201', 'Licencia sin Sueldo por Asuntos Particulares', 'Es la facultad de la autoridad para otorgar a un trabajador con nombramiento definitivo, un número determinado de días sin goce de sueldo de acuerdo a su antigüedad en la secretaría de salud.'),
(19, '2002', 'Licencia sin sueldo para desempeño de cargo de elección popular', 'Es la facultad de la autoridad para otorgar a un trabajador con nombramiento definitivo, licencia sin goce de sus percepciones a fin de cumplir con la designación de que ha sido objeto de ocupar un puesto de elección popular conservando la titularidad de su puesto.'),
(20, '2301', 'Licencia Con Sueldo Pre Pensionaria', 'Es el derecho que tiene un trabajador al disfrute de 90 días con goce de sueldo para realizar los tramites necesarios para su jubilación o pensión'),
(21, '2101', 'Licencia Con Sueldo Por Comisión Sindical', 'Es la facultad de la autoridad para otorgar a un trabajador con nombramietno definitivo, comisión con goce de sueldo para el desempeño temporal de un cargo sindical en los términos establecidos.'),
(22, '2103', 'Licencia con sueldo por comisión oficial por disfrute de beca personal', 'Es la facultad de la autoridad para otorgar a un trabajador con nombramietno definitivo, comisión con goce de sueldo para llevar a cabo estudios de especialidad o posgrado dentro y fuera del país. '),
(23, '2302', 'Licencia Con Sueldo Por Asuntos Particulares', 'Es la facultad de la autoridad para conseder al trabajador con nombramiento definitivo un número determinado de días con goce de sueldo para ausentarse de sus labores de acuerdo a su antigüedad en la secretaría de salud.'),
(24, '2202', 'Prorroga De Licencia Sin Sueldo Por Asuntos Particulares', 'Es la facultad de la autoridad para ampliar a un trabajador con nombramiento definitivo una licencia sin goce de sueldo en las términos de las condiciones generales de trabajo de la secretaria de salud.'),
(25, '2203', 'Prórroga de Licencia sin sueldo dentro y fuera de la Secretaría', 'SE AUTORIZA ESTA LICENCIA SIN GOCE DE SUELDO SIEMPRE Y CUANDO EXISTA UNA ANTERIOR PARA DAR CONTINUIDAD.'),
(26, '2204', 'Prórroga de LICENCIA SIN SUELDO PARA DESEMPENO DE CARGO DE ELECC POPULAR', 'SE AUTORIZA ESTA LICENCIA SIN GOCE DE SUELDO SIEMPRE Y CUANDO EXISTA UNA ANTERIOR PARA DAR CONTINUIDAD.'),
(27, '2405', 'Licencia médica por accidente de trabajo o enfermedad en el trabajo', 'Es la facultad que tiene el ISSSTE, de justificar a un trabjador la inasistencia a sus labores por enfermedad o accidente de trabajo'),
(28, '2406', 'Licencia de maternidad', 'Es la facultad que tiene el ISSSTE, de justificar a una trabjadora la inasistencia a sus labores por 45 días antes 45 días posteriores al parto. '),
(29, '2307', 'Licencia de paternidad', 'Es la facultad que tiene el ISSSTE, de justificar a un trabjador la inasistencia a sus labores por 5 días.'),
(30, '9110', 'Cambio de Filiación', 'Facultad de la autoridad para corregir alguno o varios datos del personal que se encuentran registrados en los archivos magneticos'),
(31, '9111', 'Cambio de Nombre', ''),
(32, '9115', 'Modificación Curp', ''),
(33, '6003', 'Cambio de adscripción', 'Movimiento que permite la transferencia de un trabajador o becario de una unidad administrativa a otra, o la radicación de sus percepciones de acuerdo a su ubicación fisíca.'),
(34, '6004', 'Cambio de centro de responsabilidad', 'Facultad de la unidad responsable para efectuar la transferencia de un trabajador o becario de un centro de responsabilidad a otro dentro de la misma unidad, ya sea por necesidades del servicio o a petición expresa del trabajador.'),
(35, '4008', 'Alta a Recursos Humanos En Formación (Médicos Residentes Nacional)', 'Es la facultad de la secretaria de salud para incorporar a los programas de formación de recursos humanos a médicos residentes, internos o pasantes de servicio social, de acuerdo a los convenios celebrados con las instituciones de enseñanza media y superior'),
(36, '4008.1', 'Alta a Recursos Humanos En Formación (Médicos Residentes Extranjero)', ''),
(37, '4008.2', 'Alta a Recursos Humanos En Formación (Pasantes de Servicio Social)', 'Es la facultad de la secretaria de salud para incorporar a los programas de formación de recursos humanos a médicos residentes, internos o pasantes de servicio social, de acuerdo a los convenios celebrados con las instituciones de enseñanza media y superior'),
(38, '4008.3', 'Alta a Recursos Humanos En Formación (Internos de Pregrado)', 'Es la facultad de la secretaria de salud para incorporar a los programas de formación de recursos humanos a médicos residentes, internos o pasantes de servicio social, de acuerdo a los convenios celebrados con las instituciones de enseñanza media y superior'),
(39, '5001', 'Promoción con Aumento de Percepciones Confianza', 'Es la facultad que tiene la autoridad para ascender a un trabajador a un puesto con el nivel mayor o calateral dentro del tabulador institucional, de acuerdo a su actitud, aptitud y desempeño'),
(40, '5001.2', 'Promoción con Aumento de Percepciones Provisional', ''),
(41, '5001.3', 'Promoción con Aumento de Percepciones Base', ''),
(42, '5002', 'Promoción por Movimiento Escalafonaria', 'Es el derecho del trabajador de base con nombramiento definitivo de asender a un puesto de mayor nivel o calateral, habiendose cumplido con los requisitos que establece el reglamento escalafonario de la sercretaria de salud.'),
(43, '5006', 'Promoción Compensada', 'Es la facultad de la autoridad para transformar un puesto a costo compensado de un recurso existente, para regularizar el código de función de un trabajador.'),
(44, '1134476', 'Promoción Compensada Confianza', 'NO APLICA, SE CONTEMPLA EN EL 5006'),
(45, '3001', 'Reanudación de labores por conclusión de Licencias Sin Sueldo', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD ,REINCORPORA AL TRABAJADOR  A OCUPAR SU PUESTO DE BASE. '),
(46, '3003', 'Reanudación de Licencia Con Sueldo', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD ,REINCORPORA AL TRABAJADOR  A OCUPAR SU PUESTO DE BASE '),
(47, '3004', 'Reanudación de licencias médicas sin sueldo', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD ,REINCORPORA AL TRABAJADOR  A OCUPAR SU PUESTO DE BASE O DE CONFIANZA'),
(48, '4001', 'Alta Personal De Base', 'Movimiento mediante el cual la Secretaría de Salud incorpora o reincorpora al trabajador a ocupar puesto de base.'),
(49, '4002', 'Alta Personal De Confianza', 'Es la facultad que se le otorga a la Secretaria de Salud para incorporar o designar a un trabajador en un puesto de Confianza.'),
(50, '4003', 'Alta Personal Provisional', 'Es la facultad de la Secretaria , de cubrir puestos por las necesidades del servicio en forma provisional,  designando a una persona para ocupar una plaza vacante.'),
(51, '4004', 'Alta Personal Interino', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD INCORPORA A SU TRABAJADOR DE FORMA QUE CUBRA VACANTES GENERADAS POR LICENCIAS POR UN TIEMPO DETERMINADO.'),
(52, '4005', 'Alta Personal Eventual', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD INCORPORA A SU TRABAJADOR EN UNA PARTIDA 1202( SUELDOS AL PERSONAL EVENTUAL), CONSTITUIDA POR UNA AUTORIZACION PRESUPUESTARIA DE LA SHCP'),
(53, '5001', 'Promoción con Aumento de Percepciones Confianza', 'Es la facultad que tiene la autoridad para ascender a un trabajador a un puesto con el nivel mayor o calateral dentro del tabulador institucional, de acuerdo a su actitud, aptitud y desempeño'),
(54, '9120.2', 'Alta Artículo 34 como Ganador', 'ACTO POR MEDIO DEL CUAL LA SECRETARIA DE SALUD ,INCORPORA  A SU TRABAJADOR  A OCUPAR PUESTO DE CONFIANZA.  INCLUYENDO MANDOS MEDIOS U HOMOLOGOS. '),
(55, '5001.2', 'Promoción con Aumento de Percepciones Provisional', 'Es la facultad que tiene la autoridad para ascender a un trabajador a un puesto con el nivel mayor o calateral dentro del tabulador institucional, de acuerdo a su actitud, aptitud y desempeño'),
